package main

import "fmt"

func main() {
	fmt.Println(part1())
	fmt.Println(part2())
}

func part1() int {
	return react(parseInput(input)).Size()
}

func part2() int {
	start := parseInput(input)
	min := start.Size()
	for i := 0; i < 26; i++ {
		cpy := removeUnits(start, 'A'+byte(i))
		length := react(cpy).Size()
		if length < min {
			min = length
		}
	}
	return min
}

func removeUnits(head *node, unit byte) *node {
	var result, last *node
	for curr := head; curr != nil; curr = curr.Next {
		other, _ := normalize(curr.Sym)
		if other != unit {
			next := &node{Sym: curr.Sym}
			if last != nil {
				last.Next = next
			} else {
				result = next
			}
			next.Prev = last
			last = next
		}
	}
	return result
}

func react(node *node) *node {
	head := node
	for curr := head; curr != nil && curr.Next != nil; {
		if opposites(curr.Sym, curr.Next.Sym) {
			if curr.Prev != nil {
				prev := curr.Prev
				next := curr.Next
				prev.Next = next.Next
				if next.Next != nil {
					next.Next.Prev = prev
				}
				curr = prev
			} else {
				head = curr.Next.Next
				head.Prev = nil
				curr = head
			}
		} else {
			curr = curr.Next
		}
	}
	return head
}

func opposites(a, b byte) bool {
	x, signX := normalize(a)
	y, signY := normalize(b)
	return x == y && signX != signY
}

func normalize(x byte) (byte, bool) {
	if x >= 65 && x <= 90 {
		return x, true
	} else {
		return x - ('a' - 'A'), false
	}
}

type node struct {
	Sym  byte
	Next *node
	Prev *node
}

func (n *node) Size() int {
	var result int
	for curr := n; curr != nil; curr = curr.Next {
		result++
	}
	return result
}

func parseInput(input string) *node {
	head := &node{Sym: input[0]}
	prev := head
	for i := 1; i < len(input); i++ {
		next := &node{Sym: input[i], Prev: prev}
		prev.Next = next
		prev = next
	}
	return head
}

